import "./Navbar.css";

const Navbar = () => {
    return (
        <nav className="navbar_style">
            <h1>Gk Bloger</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/">Photos</a>
                <a href="/">video</a>

            </div>
        </nav>
    );
}

export default Navbar;
